import dsotm from '../assets/thedarksideofthemoon.jpg'
import Sidebar from './sidebar';
import Stack from '@mui/material/Stack';


import '../styles/homeView.css';

export default function HomeView() {
  return (
    <div className="homeView">
      <Sidebar></Sidebar>
      <Stack spacing={0} direction="column">

        <div className='home'>
        <div className="cover">
          <div className="cover-content">
            <h1>Titre de la page</h1>
            <p>Description de la page</p>
        <button>Bouton</button>
      </div>
    </div>
        </div>

        <div className='footer'>
          <p>Musicboxd. Application créée par un <a href='https://www.linkedin.com/in/tom-philippe-214a9a224/' className='lien'>étudiant français</a>. Données : <a href='https://deezer.com' className='lien'>Deezer </a></p>
        </div>

      </Stack>
    </div>
  );
}
